INSERT INTO `soal` VALUES ('403','8','1',' Dampak AI terhadap masa depan dunia kerja merupakan topic yang banyak didiskusikan dan diperdebatkan. Beberap ahli percaya bahwa AI akan menyebabkan perpindahan pekerja manusia, sementara yang lain berpendapat bahwa AI akan menciptakan peluang baru dan menyarah pada peningkatan produktifitas dan pertumbuhan ekonomi <br>Ide pokok paragraf tersebut adalah&hellip;&hellip;.','1',' Topik yang banyak diperdebtkan',' AI akan menyebabkan perpindahan pekerja manusia',' Dampak AI terhadap masa depan dunia kerja',' AI akan menciptakan peluang baru',' AI akan meningkatkan pertumbuhan ekonomi','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('404','8','2',' Ayam ras pedaging disebut juga broiler, merupakan jenis ras unggulan hasil persilangan dari bangsa-bangsa ayam yang memiliki daya produktivitas tinggi, terutama dalam memproduksi daging ayam. Ayam broiler atau ayam pedaging ini sangat dikenal seluruh lapisan masyarakat Indonesia, baik di desa maupun di kota. Ciri-ciri umum broiler sebagai berikut: kerangka tubuh besar, pertumbuhan badan cepat, dan pertumbuhan bulu cepat. Broiler memiliki karakteristik ekonomis dengan ciri khas pertambahan bobot badan yang cepat, konversi ransum yang baik dan dapat dipotong pada usia yang relatif muda. Hal ini membuat sirkulasi pemeliharaan lebih cepat dan efisien serta menghasilkan daging yang berkualitas baik&hellip;..  <br>Inti dari penggalan bacaan tersebut mengenai&hellip;&hellip;&hellip;','1',' Ciri-ciri ayan broiler',' Ayam ras broiler',' Kegunaan ayam broiler',' Cara pemeliharaan ayam broiler',' Definisi ayam broiler','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('405','8','3',' Perhatikan ilustrasi dari teks berikut!&nbsp;<br> Anton siswa SMK kelas X yang  baru saja berusia 15 tahun. Dia berangkat sekolah naik sepeda motor.Karena belum cukup umur dia ditilang polisi. Dia tidak membawa SIM, STNKnya tertinggal, serta tidak memakai helm. Kejadian itu diceritakan Anton kepada guru dan teman-temannya. Temannya mengatakan padanya bahwa pada kasus itu Antonlah yang bersalah. Gurunya juga menegur dan menasehatinya. Namun Anton tersinggung karena merasa tidak ada yang membelanya.<br> Setetelah selesai membaca ilustrasi teks di atas, berilah komentar bagaimana seharusnya sikap Anton&hellip;&hellip;&hellip;','1',' Anton tidak perlu tersinggung  dan sadar bahwa dia bersalah ',' Anton pantas tersinggung karena tidak ada yang membelanya',' Orang tua anton seharusnya tidak memperbolehkan Anton naik sepeda',' Guru Anton benar, dia harus menegurnya',' Anton pantas marah karena temannya gak mau membelanya','A',NULL,'','','','','','');
