INSERT INTO `soal` VALUES ('445','8','43',' Cermatilah kutipan naskah drama berikut!Mas Abu :Hasilnya? Pasukan musuh itu mampus semuanya dan senjata-senjatanya kami rampas semuanya. kalau aku terkenang lagi kepada pertempuran-pertempuran seperti itu, kadang-kadang aku ingin kembali ke zaman perang revolusi itu. Sungguh mati Saudara-Saudara.Samsu :(Sambil makan kroket) Ya, ya aku bisa mengerti, sebab aku pun begitu juga. Sumantri : (Sambil mengaduk kopi susunya) Saudara di mana ketika itu?Samsu : Saya? Saya ketika itu berada di lereng Gunung Galunggung, saya pun memimpin satu pasukan. <br> Isi kutipan naskah drama tersebut adalah','1','Seorang pejuang yang terkenang pada saat perang revolusi.','Seorang pejuang yang berhasil menghabisi lawannya saat perang revolusi.','Seorang pemimpin pasukan yang memimpin perang pada saat perang revolusi.','Seorang pejuang yang meragukan kepemimpinan pejuang lainnya.','Seorang pejuang yang memahami keberadaan pejuang pada saat perang revolusi.','A',NULL,'','','','','','');
