INSERT INTO `soal` VALUES ('487','9','35','<p>Perhatikan pernyataan berikut !</p>\r\n<ol>\r\n<li>Saat kuliah anda bisa bersantai lebih dahulu. Sebab ada beberapa kampus yang menerapkan jam kuliah siang yakni pukul 09.00 sama seperti jam mulai sekolah di SMA dahulu</li>\r\n<li>Pekerjaan rumah atau PR rupanya tidak hanya anda temukan di bangku SMA/SMK, karena dikampus pun nantinya akan ada yang namanya tugas kuliah yang tentunya jauh lebih rumit pengerjaannya dibanding PR saat SMA/SMK dulu</li>\r\n<li>Jika anda memilih mata kuliah favorit, maka anda akan masuk kelas dengan jumlah mahasiswa yang cukup banyak, hampir sama dengan jumlah satu kelas saat SMA/SMK dulu</li>\r\n<li>Bukan hanya saat SMA/SMK saja Anda punya guru favorit , sebab saat kuliah pun nantinya anda akan menemukan yang namanya dosen favorit</li>\r\n<li>Sama-sama menempuh jenjang pendidikan, setelah menyelesaikannya, baik di SMA/SMK ataupun saat di bangku perkuliahan, Anda akan mendapatkan yang namanya rapot</li>\r\n</ol>\r\n<p>Berdasarkan pernyataan diatas persamaan antara SMA/SMK dan kuliah yang benar, yaitu nomor...</p>','1','<p>(1),(2) dan (3)</p>','<p>(1),(2) dan (4)</p>','<p>(2),(3) dan (4)</p>','<p>(1),(3) dan (5)</p>','<p>(3),(4) dan (5)</p>','A','','','','','','','');
