INSERT INTO `soal` VALUES ('489','9','37','<p>Perhatikan pernyataan berikut!</p>\r\n<ol>\r\n<li>Pilihlah negara yang sistem. Jurusan perkuliahan di luar pendidikannya memberikan sedikit kesempatan dan didukung dengan teknologi dan sumber daya yang kurang maju.</li>\r\n<li>Pilihlah perguruan tinggi di luar negeri yang dekat dengan negara Anda Indonesia karena mutunya terbaik</li>\r\n<li>Tidak bisa dimungkiri biaya kuliah di luar negeri tentu lebih mahal daripada kuliah di dalam negeri. Oleh karena itu, pertimbangkan biaya kuliah rata-rata di suatu negara sebelum memutuskan mau kemana agar biaya pendidikan sesuai dengan kemampuan</li>\r\n<li>Kuasailah bahasa asing dan sesuaikan 10. Perhatikan pernyataan beri kemampuan bahasa asing ketika memilih negara tujuan kuliah.</li>\r\n<li>Perhitungkan komponen biaya hidup yang harus dikeluarkan sebelum memilih negara tujuan kuliah agar tidak melampaui kemampuan.</li>\r\n</ol>\r\n<p>Berdasarkan pernyataan di atas pertimbangan dalam memilih negara tujuan kuliah yang benar ditunjukkan nomor..</p>','1','<p>(1),(2) dan (3)</p>','<p>(1),(2) dan (4)</p>','<p>(2),(3) dan (4)</p>','<p>(1),(3) dan (5)</p>','<p>(3),(4) dan (5)</p>','E','','','','','','','');
