INSERT INTO `soal` VALUES ('492','9','40',' Berikut ini yang bukan termasuk keunggulan universitas-universitas di Amerika Serikat yaitu...','1','  Amerika adalah negara yang mapan dan sistem pendidikan universitasnya telah terancang dengan matang. Menurut Times Higher Education World University 2013/2014, 7 dari 10 universitas terbaik di dunia berada diAmerika Serikat',' Negara Amerika sangat luas dan memiliki keanekaragaman geografis. Pelajar dapat memilih apakah ingin tinggal di daerah tropis atau daerah yang sejuk sepanjang tahun',' Amerika Serikat menawarkan program kuliah yang beragam, dari program akademis seperti fisika nuklir, hingga program studi kreatif seperti seni dan sinematografi',' Kebudayaan Amerika yang bebas sangat buruk sekali bagi mahasiswa batas yang berkuliah disana khususnya pelajar dari Indonesia',' Pemerintah Amerika mengeluarkan biaya yang fantastis untuk penelitian. Tak heran, pelajar yang ingin melanjutkan S-2 memilih negara ini untuk bersekolah','D',NULL,'','','','','','');
