INSERT INTO `soal` VALUES ('555','7','10',' Hubbah adalah seorang anak dari keluarga miskin, bapaknya pedagang buah di pasar yang penghasilannya hanya dapat mencukupi kebutuhan pokok saja. Keluarga Hubbah termasuk kelompok masyarakat yang kekurangan, tetapi ia termasuk orang yang selalu berusaha berdoa dan mengharapkan anugrah Allah Swt. karena dia yakin Allah akan mengabulkan doanya. Perilaku Hubbah adala contoh orang Sabar dalam menghadapi ujian dan cobaan. Berikut ini adalah keutamaan orang dan balasan orang sabar dalam menghadapi ujian dan cobaan ....','1',' selalu berburuk sangka',' memperoleh teman yang banyak',' selalu mendapatkan yang ia inginkan',' memperoleh kasih sayang manusia',' memperoleh martabat yang tinggi di surge','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('556','7','11',' Perhatikan teks narasi berikut. &ldquo;Di sudut pasar Madinah Al-Munawarah ada seorang pengemis Yahudi buta, yang setiap hari selalu menghina Rasulullah Saw., dan apabila ada orang yang mendekatinya ia selalu berkata, wahai saudaraku jangan dekati Muhammad nanti kalian akan dipengaruhinya. Tidak orang yang peduli kepadanya akan tetapi setiap pagi Rasulullah Saw. mendatanginya dengan membawa makanan, dan tanpa berkata sepatah kata pun Rasulullah Saw. menyuapi makanan yang dibawanya kepada pengemis itu&rdquo;.Dari teks narasi tersebut yang harus kita teladani dari sikap pribadi Rasulullah Saw adalah ....','1',' Cara menyapa orang buta',' Cara menyampaikan dakwah',' Akhlak dan pribadi Rasulullah Saw.',' Pengemis yang tidak tahu berterimakasih',' Kebaikan tidak selalu dibalas dengan kebaikan','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('557','7','12',' Ardi seorang pelajar SMA yang baru lulus, dia bercita-cita ingin melanjutkan ke perguruan tinggi fakultas teknik Universitas Gajah Mada Yogyakarta. Dengan semangat belajar yang gigih, disertai rajin salat dan beribadah Ardi diterima di fakultas tersebut. Selama diifakultas teknik Ardi tetap selalu salat, baca Al-Qur&rsquo;an dan bangun malam untuk melakukan salat tahajud. Dari teks narasi tersebut dapat diambil pelajaran bahwa &hellip;','1',' Mahasiswa harus taat beribadah',' Ardi seorang yang khusuk dalam salatnya',' Orang yang bersyukur akan ditambah nikmatnya',' Ardi adalah mahasiswa yang rajin membaca Al-Qur&rsquo;an',' Ardi seorang muslim yang bersyukur dengan tetap istiqomah dalam ibadah','E',NULL,'','','','','','');
