INSERT INTO `soal` VALUES ('560','7','15',' Manusia tidak bersifat ma&rsquo;sum, di suatu waktu memungkinkan berbuat khilaf atau dosa. Berdasarkan ajaran Islam, bila kita berbuat khilaf atau dosa, maka segera &hellip;.','1',' bertaubat memohon ampun atas dosa yang dilakukan',' menangisi dan mengakui atas kelemahan diri sendiri',' melakukan konsultasi dengan ustadz atau guru ngaji',' membaca Al-Qur&rsquo;an dan memohon ampun Allah',' berupaya menenangkan diri untuk tidak depresi','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('561','7','16',' Keimanan seseorang memiliki ciri yang sangat khas dan bersifat dinamis.Mayoritas ulama memandang keimanan selalu beriringan dengan amal saleh, sehinga mereka menganggap keimanan akan bertambah dengan bertambahnya amal saleh, demikian juga kondisi hati manusia yang selalu dinamis sehingga kadang iman bertambah dan adakalanya berkurang. Contoh berikut merupakan kondisi bertambahnya keimana seseorang .... ','1',' Pak Fulan setelah menuaikan ibadah haji bertambah pelit dan jarang bersedekah',' Setelah panen raya, Pak Semongko bersedekah dengan membagikan sebagian hasil penen yang afkiran',' Pak Apollo saat bercocok tanam berniat akan bersedekah jika hasil tanamanya untung banyak',' Ibu Fulanah setiap kegiatan Dasa Wisma selalu membawa makanan-makanan ringan',' Pak Johan setelah panen hasil sawahnya selalu mengeluarkan zakat 2,5 % dan bersedekah kepada para tetangganya','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('562','7','17','<p>Perhatikan potongan Q.S. al-Anfal ayat 2 berikut!</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n<p>Contoh perilaku yang sesuai dengan kandungan dalam ayat yang bergaris bawah adalah ....</p>','1','<p>Imran selalu khusuk berzikir di masjid sebelum melakukan salat fardu</p>','<p>Setelah melakukan salat dhuhur, Ali bersegera kembali ke tempat pekerjaannya</p>','<p>Ketika mendengar adzan, Amir bersegera mengambil air wudhu dan pergi ke masjid</p>','<p>Husna selalu membawa makanan ke sekolah untuk diberikan kepada teman-temanya</p>','<p>Ketika ayat Al-Qur&rsquo;an dikumandangkan dari masjid, Fulan tetap asyik bermain game online</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('563','7','18',' Edi dan Nanang berboncengan ketika pulang sekolah, di pertigaan tiba-tiba melihat teman dari sekolah lain terjatuh dari sepeda dan sontak Edi dan Nanang berhenti untuk menolong. Sikap Edi dan Nanang semacam ini termasuk ....','1',' Ihsan kepada makhluk Allah',' Ihsan kepada sesama manusia',' Supaya dikatakan suka menolong',' Panggilan nurani sebagai manusia',' Merasa terpanggil untuk menolong','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('564','7','19',' Pada saat bertemu Rasulullah Saw. dan kaum muslimin ia berbohong dengan cara menceriterakan kejelekan orang orang kafir. Pada saat bertemu orang kafir ia mengaku bagian dari orang kafir dan menjelekjelekan kaum muslimin dan Rasulullah Saw. Pada saat bertemu kaum muslimin dan Rasulullah Saw., ia mengaku bagian dari kaum muslimin dan siap melawan kaum kafir quraisy. Tokoh munafik ini bernama ....','1',' Abdullah bin Umar',' Abdullah bin Jahsyi',' Abdullah bin Ubay',' Abu Jahal',' Abu Lahab ','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('565','7','20','<p>Perhatikan Hadist berikut!</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n<p>Teks hadis tersebut menceriterakan tentang ciri-ciri orang munafik, adapun arti teks yang bergaris bawah mengandung maksud ....</p>','1','<p>Orang munafik apabila berkata selalu bohong</p>','<p>Orang kafir selalu memusuhi orang mukmin</p>','<p>Orang zindik suka dengan perbuatan dosa</p>','<p>Orang jahat selalu berpura-pura baik</p>','<p>Orang munafik apabila berjanji suka mengingkari</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('566','7','21','<p>Karakter sifat orang munafik selalu merasa tidak tenang jika ia ketahuan sifat dusta dan khianatnya akan menjadi sakit batin yang pada akhirnya membawa kesengsaraan di dunia dan akhirat. Penggalan ayat Al-Qur&rsquo;an yang sesuai dengan narasi tersebut adalah ....</p>','1','<p><img src=\"data:image/png;base64,\" /></p>','<p><img src=\"data:image/png;base64,\" /></p>','<p><img src=\"data:image/png;base64,\" /></p>','<p><img src=\"data:image/png;base64,\" /></p>','<p><img src=\"data:image/png;base64,\" /></p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('567','7','22',' Perhatikan karakteristik manusia berikut!1) Bersumpah palsu2) Menghalangi jalan Allah3) Menghardik anak yatim4) Tampilan lahir dan batin berbeda5) Manis perkataan tapi buruk hatiDari pernyatan-pernyataan tersebut yang merupakan karakteristik munafiqin adalah ....','1',' 1, 2, 3 dan 4',' 1, 2, 4 dan 5',' 2, 3, 4 dan 5',' 2, 3 dan 4',' 2, 3 dan 5','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('568','7','23',' Pada era digital seperti sekarang ini dan segala sesuatu yang serba canggih terkadang memberikan suatu perubahan yang tidak pasti, baik dari segi moral, nilai kehidupan dan spritual. Semakin cepat perubahan itu, semakin maju pula masyakat serta tuntunan hidup yang harus dipenuhi oleh manusia. Oleh karena itu, orang sering tidak mampu untuk mengatasi permasalahan yang dihadapi sehingga menimbulkan rasa stres yang memicu muculnya rasa gelisah dan krisis rohani dan permasalahan spiritual sehingga menimbulkan kerasnya hati manusia.Keras hati dalam bahasa agama sering disebut dengan ....','1',' Qalbun salim',' Qaswah al-Qalb',' Qalbun mayyitun',' Nifaq',' Kufur','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('569','7','24',' Pak Fulan sudah dua tahun menderita sakit gula sehingga sangat hati-hati ketika makan dan minum. Pak Fulan menerima musibah ini dengan hati yang ikhlas, sabar dan selalu berdo&rsquo;a kepada Allah Swt agar penyakitnya segera diangkat dan bisa sehat kembali. Dari cerita tersebut Pak Fulan termasuk orang yang memiliki ....','1',' Qalbun Salim',' Mayyit al-qalb',' Maridh al-qalb',' Qaswat al-qalb',' Qalbun mayyitun','A',NULL,'','','','','','');
