INSERT INTO `soal` VALUES ('894','14','27',' Tuhan Yesus menghendaki kita sebagai ranting anggur yang baik yang &ldquo;berbuah&rdquo; untuk Tuhan dan sesama. Arti dari penyataan tersebut adalah &hellip;.','1',' dalam kehidupan orang percaya harus memiliki tanda, dan menunjukkan tanda kalau menjadi orang beriman','  dalam kehidupan orang percaya harus bisa menjadi berkat dan keteladanan dalam hal kebaikan bagi Tuhan dan sesama','  dalam kehidupan orang percaya harus hidup berdampingan dengan orang yang tidak percaya','  dalam kehidupan orang percaya harus menghargai sesame dan berbakti kepada Tuhan','  dalam kehidupan orang percaya harus bisa menjadi garam dan terang dunia','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('895','14','28',' Yang dapat kita teladani dari Yesus dalam hubungan dengan kedewasaan adalah ....','1',' hikmat dan pengenalan akan Allah bertambah','  fisik bertumbuh dengan baik','  memiliki ketahanan tubuh yang kuat','  tidak menyalurkan emosi dengan baik','  membantu teman yang membutuhkan','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('896','14','29',' Ciri-ciri orang yang sudah dewasa dalam aspek sosial adalah ....','1',' ikut merokok, minum minuman keras agar dapat diterima lingkungan','  mengikuti gang &ldquo;anak gaul&rdquo; agar dapat diterima lingkungan','  sanggup melawan tekanan teman sebaya dan tidak mudah terpengaruh','  tidak bergaul dengan siapapun agar tidak terpengaruh','  tidak membangun komunikasi secara terbuka dengan orang yang berbeda agama','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('897','14','30',' Bentuk lain dari ungkapan takut akan Tuhan dapat kita wujudkan dengan &ldquo;tidak menjadi serupa dengan dunia ini&rdquo;. Maksudnya adalah ....','1',' dapat membedakan mana kehendak Allah untuk dilakukan dan mana yang bukan','  dapat membedakan sesama dari status sosial','  dapat membedakan mana yang baik dan yang tidak baik menurut ukuran diri sendiri','  dapat membedakan penampilan yang bagus dan tidak bagus','  dapat menghindari semua bentuk pergaulan di dunia ini','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('898','14','31',' Masa remaja biasanya disebut masa pembentukan identitas. Artinya ....','1',' masa inilah terjadi proses pencarian dan pemantapan sifat serta kebiasaan yang akan menjadi ciri khas seseorang dan dipertahankan sampai sisa hidupnya','  masa yang indah ini tidak akan pernah berubah sepanjang hidup manusia','  masa depan seseorang hanya ditentukan oleh masa mudanya','  masa inilah masa yang akan mudah terlupakan karena diisi dengan kegiatan yang silih berganti','  masa remaja harus dipertahankan dan berusahalah tidak menjadi tua karena masa muda itu indah','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('899','14','32',' Pengaruh dari teman sebaya dalam mengembangkan karakter seorang remaja sering kali menyesatkan. Contoh pengaruh tersebut adalah....','1',' menganut prinsip pola hidup konsumtif','  dalam bersaing di sekolah harus menganut prinsip bersaing sehat','  dalam penampilan pakaian harus memakai pakaian yang rapi dan pantas','  remaja boleh bebas bergaul asal bertanggung jawab','  remaja yang tidak mau belajar dengan sungguh- sungguh akan ketinggalan jaman','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('900','14','33',' Yang termasuk contoh sikap konsumtif yang dapat merusak karakter kristiani seseorang adalah ....','1',' seorang remaja yang mengajak temannya untuk menikmati resep makanan baru','  seorang remaja yang selalu membeli barang- barang baru yang dimiliki orang lain','  seorang remaja yang mengkonsumsi makanan- makanan sehat','  seorang remaja yang selalu berusaha berpakaian bersih dan rapi','  seorang remaja yang tidak mau ketinggalan dalam mengenal teknologi','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('901','14','34',' Makna yang terkandung dalam istilah &ldquo;tidak gaul&rdquo; yang dapat bermakna postif dalam pengembangan karakter kristiani adalah ....','1',' remaja yang tidak mau bergaul dengan temannya yang kurang mampu','  remaja yang tidak mau bergaul dengan teman yang tidak sekelas/selevel dengannya','  remaja yang tidak mau ketinggalan mengikuti model rambut selebriti','  remaja yang tidak mau bergaul dengan teman yang suka berhura-hura','  remaja yang tidak mau bergaul dengan teman yang suka kerja keras','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('902','14','35',' Sebagai remaja Kristen yang bertumbuh secara fisik, sikap yang benar dari remaja setelah sadar akan pertumbuhan fisiknya adalah &hellip;.','1',' bersikap berlebihan dan meyembongkan diri karena kecantikan dan ketampanannya','  menyesali segala yang ada padanya karena banyak kekurangan. Dan menyalahkan orang tua mengapa dilahirkan ke dunia','  mensyukuri dan mencintai dirinya sebagaimana dirinya apa adanya serta mampu menjaga diri','  bersikap biasa biasa saja karena semua sudah terlanjur','  bersyukur dan mengagungkan orang tua karena sudah dilahirkan ke dunia','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('903','14','36',' Roh Kudus akan memimpin orang percaya untuk hidup benar di hadapan Allah. Dia menuntun orang percaya berjalan dalam kebenaran sehingga orang percaya hidup dalam standar-standar hidup yang Allah tetapkan.Yang dimaksud dengan standar-standar hidup yang Allah tetapkan adalah &hellip;.','1',' percaya akan pengharapan yang Allah janjikan',' bergaul dan berperilaku yang sesuai dengan etika Kristen',' dengan tekun dan taat dalam mempelajari firman Tuhan',' berani untuk memberitakan Injil Tuhan dalam persekutuan remaja',' memberikan pelayanan kasih kepada orang-orang yang belum beruntung','B',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('904','14','37',' Proses hukum yang diberlakukan terhadap orang yang mengakhiri nyawa orang lain merupakan perlindungan terhadap &hellip;.','1',' hak hidup','  hak keadilan','  hak keamanan','  hak kesejahteraan','  hak kemerdekaan','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('905','14','38',' Seorang remaja Kristen bernama Romi, memiliki rasa ketertarikan terhadap teman perempuan di kelasnya (bukan Kristen). Dia tertarik terhadap perempuan tersebut karena perilakunya yang sangat baik. Sikap yang seharusnya ditunjukkan Romi sebagai remaja Kristen adalah &hellip;.','1',' memilih perempuan itu menjadi pasangan yang sepadan','  tidak lagi bergaul dan berteman dengan perempuan tersebut','  mengajak perempuan itu supaya masuk beragama Kristen','  tidak menjalin hubungan perempuan itu menjadi pacar, namun tetap bersahabat','  menjalin hubungan dan tetap berkomitmen menjauhkan diri dari percabulan','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('906','14','39','  1 korintus 6; 19- 20 : tertulis &ldquo; sebab kamu telah dibeli dan harganya telah lunas dibayar, karena itu muliakanlah Allah dengan tubuhmu!&rdquo;. Peran Roh Kudus dalam ayat tersebut yang membaharui kehidupan adalah&hellip;.','1',' orang percaya sudah diantar kesurga','  dosa manusia telah ditebus oleh pengorbanan Yesus','  orang percaya diangkat sebagai anak Allah','  dikembalikan citranya dalam gambar dan rupa Alah','  dipulihkan harkat kemanusiaannya sebagai manusia sempurna.','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('907','14','40','<p>Perhatikan buah Roh berikut ini:</p>\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n<p>Berdasarkan pernyataan di atas, nilai yang diperlukan dalam menghadapi gaya hidup modern ditunjukkan pada nomor &hellip;.</p>','1','<p>(1), (4), dan (9)</p>','<p>(2), (3), dan (5)</p>','<p>(3), (6), dan (7)</p>','<p>(4), (7), dan (8)</p>','<p>(5), (8), dan (9)</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('908','14','41',' Setiap pribadi dapat bertumbuh dewasa secara jasmani dan berkembang dalam segala aspek, baik intelektual, emosi, sosial, moral maupun spiritual. Ciri pribadi yang dewasa secara spiritual di bawah ini, adalah.....','1',' bertambah usia, berat badan dan tinggi badan','  menggunakan akal budi dalam melakukan penilaian','  mampu mengendalikan perasaan dengan cara yang tepat','  mampu menempatkan diri dalam lingkungan','  mengakui kebesaran Tuhan dalam menciptakan alam semesta','E',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('909','14','42',' &ldquo;Manusia adalah rekan sekerja Allah.&rdquo; Makna dari pernyataan ini adalah: ...','1',' manusia memiliki kuasa setara dengan Allah','  Allah mengerjakan semua pekerjaan manusia','  pekerjaan Allah dapat dimengerti oleh manusia','  manusia bertugas menjaga kelestarian ciptaan yang lain','  manusia menjadi seperti Allah','D',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('910','14','43',' Di era kemajuan teknologi sekarang ini, banyak ditemukan keadaan alam yang rusak. Melihat kenyataan ini, penyebab utama rusaknya alam kita adalah...','1',' akibat kesalahan dan keserakahan manusia','  kesalahan mesin industri','  matahari semakin panas','  dampak krisis ekonomi','  Efek rumah kaca','A',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('911','14','44',' Banyak orang menyerukan pemeliharaan alam, seperti &ldquo;go green!&rdquo;, &ldquo;back to nature&rdquo;, dsb. Sebagai orang Kristen, makna kita memelihara alam ini adalah ... .','1',' mengikuti perkembangan jaman','  agar sama dengan orang lain','  karena kita dapat keuntungan','  karena alam adalah milik Allah','  alam menjadi pendukung kehidupan manusia ','E',NULL,'','','','','','');
