INSERT INTO `soal` VALUES ('1035','15','14',' Tom: I think online learning is more effective than traditional classroom learning.Jane: _________ Online classes are more flexible, but I believe face-to-face interaction is important for a better learning experience.What is the most appropriate response to complete Jane&#39;s sentence?','1',' I totally agree. Online learning is the best.',' I couldn&rsquo;t agree more. It&rsquo;s much easier to learn online.',' I disagree. I think classroom learning is more beneficial.',' I&rsquo;m not sure. I think both methods have their advantages.',' I completely disagree. Online learning should be avoided.','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('1036','15','17',' Michael: I think technology has made our lives much easier.David: _________ Technology has certainly brought many benefits, but it also has some negative effects.What is the most appropriate response to complete David&#39;s sentence?','1',' I completely agree. Technology has made everything easier.',' I disagree. Technology has only caused problems.',' I partially agree. While technology is helpful, it can be overwhelming at times.',' I&rsquo;m not sure. It&rsquo;s hard to say if technology is really helpful.',' I agree. Technology is just a trend and it will pass.','C',NULL,'','','','','','');
INSERT INTO `soal` VALUES ('1037','15','18',' Anna: I believe that eating vegetables every day is essential for staying healthy.Emma: _________ Vegetables are great, but I think it&#39;s okay to eat them only a few times a week.What is the most appropriate response to complete Emma&#39;s sentence?','1',' I completely agree. Vegetables are necessary for health.',' I disagree. Eating vegetables every day is too much.',' I partially agree. Eating vegetables daily is ideal, but a few times a week is fine.',' I don&rsquo;t agree with you. Vegetables are overrated.',' I totally disagree. Vegetables are not needed at all.','C',NULL,'','','','','','');
