INSERT INTO `soal` VALUES ('1069','15','15','<p>Sarah: I believe that everyone should exercise at least three times a week.</p>\r\n<p>Lisa: _________ I think regular exercise is important, but sometimes people are too busy to keep up with that schedule.</p>\r\n<p>What is the most appropriate response to complete Lisa\'s sentence?</p>\r\n<p>&nbsp;</p>','1','<p>I agree with you. Three times a week is perfect.</p>','<p>I disagree. People should prioritize their health and make time for exercise.</p>','<p>I partially agree. I believe it\'s better to exercise when you can.</p>','<p>I&rsquo;m not sure. I think three times a week is too much.</p>','<p>I totally disagree. It&rsquo;s unnecessary to exercise regularly.</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('1070','15','16','<p>John: I think the government should invest more in public transportation.</p>\r\n<p>Rachel: _________ I think it\'s a good idea to improve public transport, but the government should also focus on road infrastructure.</p>\r\n<p>What is the most appropriate response to complete Rachel\'s sentence?</p>\r\n<p>&nbsp;</p>','1','<p>I agree completely. Public transportation should be the priority.</p>','<p>I totally disagree. Roads are more important than public transport.</p>','<p>I disagree with you. We don&rsquo;t need more public transport.</p>','<p>I agree with you. It\'s important to have a good balance between both.</p>','<p>I don\'t think it matters much. Both are equally important.</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('1071','15','44','<p>If someone says, \"I believe that everyone should work from home,\" how could you politely disagree?</p>','1','<p>I understand your point, but I believe working in an office is more productive for some people.</p>','<p>I think working from home is the best, and there\'s no reason to work in an office.</p>','<p>I agree completely. Everyone should work from home.</p>','<p>I disagree; I think working from home can be isolating and difficult for some people.</p>','<p>I don\'t see the need for working from home; it should be banned.</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('1072','15','45','<p>If someone says, \"I think that technology is making people lazy,\" how could you give a counter-opinion?</p>','1','<p>I don&rsquo;t agree. Technology actually helps people become more efficient and productive.</p>','<p>I think you are right. Technology makes us lazy and dependent.</p>','<p>I disagree with you. Technology has no effect on people\'s productivity.</p>','<p>I completely agree. We should stop using technology.</p>','<p>I think you&rsquo;re wrong. Technology is only harmful.</p>','A','','','','','','','');
